import { useContext, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import Layout from "../components/layout/index";
import Innerlayout from "../components/layout/Innerlayout";
// import Header from "../components/Headerdata/HeaderData";
import { Headercontext } from "../components/Headerdata/HeaderData";

const Home = () => {
  const navigate = useNavigate();

  const { userDetails, token, setLogin, setToken, setToastMessage } =
    useContext(Headercontext);
  const [logoutState, setLogoutState] = useState(false);

  function logOut() {
    localStorage.clear();
    setToken(null);
    setToastMessage({
      display: true,
      message: "Logged Out Successfully",
    });
    setLogoutState(false);
  }
  return (
    <Layout>
      <Innerlayout heading={"User Data"}>
        {token ? (
          <>
            <div className="">
              <>
                <div className="">
                  <div className="">
                    {userDetails.picture && (
                      <img src={userDetails.picture} className="" />
                    )}
                    <p className="">{userDetails.username}</p>
                    <p className="">{userDetails.userEmail}</p>
                  </div>
                  <div className="" onClick={logOut}>
                    {/* <img
                        src="../assets/icon/logout.png"
                        className="w-[15px]"
                      /> */}
                    <p className="forgot-password">Logout</p>
                  </div>
                </div>
              </>
            </div>
          </>
        ) : (
          <Link to="/signin">
            <p className="forgot-password">Sign In</p>
          </Link>
        )}
      </Innerlayout>
    </Layout>
  );
};

export default Home;
